import React from 'react'

function NameList() {
    // const names = ['Bruce', 'Clark', 'Diana', 'Jonny Depp'];
    const persons = [
        {
            id: 1,
            name: 'Bruce',
            age: 21,
            skill: 'React'
        },
        {
            id: 2,
            name: 'Clark',
            age: 23,
            skill: 'Angular' 
        },
        {
            id: 3,
            name: 'Diana',
            age: 21,
            skill: 'Vue'
        }
    ]
    const personsList = persons.map(person => {
        return(
            <h2 keys={person.id}>I am {person.name}. My age is {person.age} year old. I know {person.skill}</h2>
        )
      });
    return (
        <div>
            {
                personsList
            }
        </div>
    )
}

export default NameList
